{{DISPLAYTITLE:List of quest release dates}}
{{External|rs=List of quests by release date}}
This is a '''list of [[quests|quest]] release dates''' in reverse chronological order. The total possible [[quest points]] (QP) at the time of release of each quest is also given.

All quests released before [[Monkey Madness II]] are "vanilla" quests that were present in the [[August 2007 Archive of RuneScape]] at the time ''Old School RuneScape'' launched. Most quests released after were exclusively developed for ''Old School'', but starting with [[Land of the Goblins]] some quests released in ''[[RuneScape 2|RuneScape]]'' after the August 2007 archive have been [[backported]] or extracted from the archive and re-released into ''Old School'' with some adjustments.

{{QuestClass|align=right}}

{{clear}}
<!-- when adding a new quest to this list use:
{{QuestRelease
|nr = chronological number of quest
|name = name of quest without "[[]]"
|alt = if quest has an alternative name when for instance "(quest)" is used in the article name (optional)
|former = if quest got replaced by a reworked quest than use "yes" (only for old quests, not new ones; optional)
|date = day and month without "[[]]"
|year = year without "[[]]"
|update = name of update without "Update:" infront of it and without "[[]]"
|qp = new amount of quest points (former total amount of quest points + rewarded quest points by this quest
|diff = difficulty of the quest; uses [[Template:QuestDifficulty]]
}}
